sorry for the uncertainly, i can never be sure on youtube,
usually when i post something political i get a pretty negative response..
so thanks for the breath of fresh air!  :-}

) hysterical Frank, but excellent Ravel.  
Bravo Jeremy Denk! 
Sarasate ... ? Joshua is great, respect and admiration.

Neuro-chemically this response is the same as being physically threatened. It impedes rational thought and disallows us to see the bigger picture, be empathic or think objectively: i.e. it creates tunnel vision. 


I would invite you to read up on some social psychology and try to apply to proven ways for improving decision-making. These include: 
-Trying your best to argue for the opposite point of view;
-Asking someone who is competent in this field;
-Reframing the question.
